import React from 'react';

const Home = () => {
  return (
    <div
      className="hero"
      style={{
        width: '100%',
        height: '100vh',
        overflow: 'hidden',
        backgroundImage: 'url("/Paginas/Imagen.png")',
        backgroundSize: 'cover',
        backgroundPosition: 'center',
      }}
    >
      <div className="hero-overlay bg-opacity-60"></div>
      <div className="hero-content text-center text-neutral-content">
        <div className="max-w-md">
          <h1 className="mb-5 text-5xl font-bold">¡Hola!</h1>
          <p className="mb-5 text-xl font-medium">
            ¡Ven y reserva ya una habitacion en uno de nuestro hoteles!. El mejor servicio de hospedaje a tu disposicion en cualquier ciudad.
          </p>
          <button className="btn btn-primary">Reservar</button>
        </div>
      </div>
    </div>
  );
};

export default Home;
